import React, { useState, useEffect } from 'react';
import Navbar from './Navbar';
import Footer from './footer';

const backgroundImages = [
  'bg-image1',
  'bg-image2',
  'bg-image3',
  'bg-image4',
  'bg-image5',
  'bg-image6',
  'bg-image7',
  'bg-image8',
  'bg-image9',
  'bg-image10',
  'bg-image11',
  'bg-image12'
];

function Home() {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => prevIndex === backgroundImages.length - 1 ? 0 : prevIndex + 1);
    }, 4000); // Change image every 4 seconds

    return () => clearInterval(interval);
  }, []);

  return (

    
    <div className="home-container">
      {backgroundImages.map((image, index) => (
        <div key={index} className={`background-image ${image} ${index === currentImageIndex ? 'active' : ''}`} />
      ))}

      {/* Integrated HTML, CSS, and JavaScript code */}
      <section>
        <div className="swiper mySwiper container">
          <div className="swiper-wrapper content">
            <div className="swiper-slide card">
              <div className="card-content">
                <div className="image">
                  <img src="img1.jpg" alt="" />
                </div>
                <div className="social-media">
                  <i className="fa-brands fa-facebook"></i>
                  <i className="fa-brands fa-twitter"></i>
                  <i className="fa-brands fa-github"></i>
                </div>
                <div className="name-profession">
                  <span className="name">Someone Name</span>
                  <span className="profession">Web Developer</span>
                </div>
                <div className="rating">
                  <i className="fa-solid fa-star"></i>
                  <i className="fa-solid fa-star"></i>
                  <i className="fa-solid fa-star"></i>
                  <i className="fa-regular fa-star"></i>
                  <i className="fa-regular fa-star"></i>
                </div>
                <div className="button">
                  <button className="aboutMe">About Me</button>
                  <button className="hireMe">Hire Me</button>
                </div>
              </div>
            </div>
            {/* Rest of the cards */}
          </div>
        </div>
        <div className="swiper-button-next"></div>
        <div className="swiper-button-prev"></div>
        <div className="swiper-pagination"></div>
      </section>

      <style>
        {`
          @import url('https://fonts.googleapis.com/css2?family=Poppins:wght@300;400;500;600;700;800;900&display=swap');
          * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Poppins', sans-serif;
          }
          body {
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background: #000;
          }
          section {
            position: relative;
            height: 500px;
            width: 1075px;
            display: flex;
            align-items: center;
          }
          .swiper {
            width: 950px;
          }
          .container {
            border-radius: 20px;
          }
          .card .image {
            width: 140px;
            height: 140px;
            border-radius: 50%;
          }
          .card .image img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 50%;
            border: 3px solid #000;
          }
          .card {
            position: relative;
            background: #000;
            border: 3px solid #0ef;
            border-radius: 20px;
          }
          .card::before {
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            background: #0ef;
            clip-path: circle(55% at 0 0);
            border-top-left-radius: 10px;
          }
          .card .card-content {
            position: relative;
            display: flex;
            align-items: center;
            flex-direction: column;
            padding: 30px;
          }
          .card .social-media {
            position: absolute;
            top: 10px;
            right: 20px;
            display: flex;
            flex-direction: column;
            align-items: center;
          }
          .card .social-media i {
            color: #fff;
            margin-top: 10px;
            cursor: pointer;
            transition: .3s;
          }
          .card .social-media i:hover {
            color: #0ef;
          }
          .card .name-profession {
            display: flex;
            align-items: center;
            flex-direction: column;
            margin-top: 10px;
            color: #fff;
          }
          .name-profession .name {
            font-size: 20px;
            font-weight: 600;
          }
          .name-profession .profession {
            font-size: 15px;
            font-weight: 500;
          }
          .card .rating {
            display: flex;
            align-items: center;
            margin-top: 18px;
          }
          .card .rating i {
            font-size: 18px;
            color: #0ef;
            margin: 0 2px;
          }
          .card .button {
            display: flex;
            justify-content: space-around;
            width: 110%;
            margin-top: 20px;
          }
          .card .button button {
            background: #0ef;
            border: none;
            outline: none;
            color: #000;
            font-weight: 600;
            padding: 8px 22px;
            border-radius: 20px;
            font-size: 14px;
            cursor: pointer;
            transition: .3s;
          }
          .card .button button:hover {
            background: #fff;
          }
          .swiper-pagination-bullet {
            height: 7px;
            width: 26px;
            background: #0ef;
            border-radius: 25px;
          }
          .swiper-button-next,
          .swiper-button-prev {
            color: #0ef;
          }
        `}
      </style>

      <script>
        {`
          var swiper = new Swiper(".mySwiper", {
            slidesPerView: 3,
            spaceBetween: 30,
            slidesPerGroup: 3,
            loop: true,
            grabCursor: true,
            loopFillGroupWithBlank: true,
            pagination: {
              el: ".swiper-pagination",
              clickable: true,
            },
            navigation: {
              nextEl: ".swiper-button-next",
              prevEl: ".swiper-button-prev",
            },
          });
        `}
      </script>

      <Footer />
    </div>
  );
}

export default Home;
